import React, { Component } from 'react';
import { REGISTER_PAGE_ID,LIST_PAGE_ID,TREE_ARR } from './constants';
export default class EditView extends Component{
  constructor(props){
    super(props);
}
onBackClick(event){
  event.preventDefault();
  this.props.onPageChange(LIST_PAGE_ID)
}
render(){

    return(
      <div>
        <h1>Edit</h1>
        <EditTree id={this.props.id}/>
        <button onClick={(event)=>this.onBackClick(event)}>Back</button>
      </div>
    );
  }
}
function EditTree(props){
  let treeObj;
  for (treeObj of TREE_ARR){
    if(treeObj.id === props.id){
      localStorage.setItem("Tree_Obj",JSON.stringify(treeObj));
    }
    break;
  }

return(
  <div>
    <h1>Good</h1>
  </div>
);
}
